import React, { useState } from "react";
import { Container, Row } from "react-bootstrap";
import { Form } from "react-router-dom";
import AtheProfileLayout from "../../components/layout/AtheProfileLayout";

const Password = () => {
  const [isChecked, setIsChecked] = useState(false);
  const handleToggle = () => setIsChecked(!isChecked);
  return (
    <AtheProfileLayout>
      <h4 className="m-2 grey mb-4">Password & Security</h4>
      <Container>
        <Row>
          <div>
            <p>Change Password</p>

            <span>Change password to login to your account.</span>
          </div>
        </Row>{" "}
        <Row>
          <div>
            <div>
              <p>2-step verification</p>

              <span>
                Add an additional layer of security to your account during
                login.
              </span>
            </div>
            <div>
              {" "}
              <Form.check
                type="switch"
                id="toggle-switch"
                label=""
                checked={isChecked}
                onChange={handleToggle}
              />
            </div>
          </div>
        </Row>
      </Container>
    </AtheProfileLayout>
  );
};

export default Password;
